import React from "react";
import T from "./TodoNav";

const Navbar = ({ todos, setTodos, filteredTodos }) => {
  let elements = filteredTodos.map((todo) => {
    let result='';
    if(todo.completed){
      result =
      <Todo
              key={todo.id}
              text={todo.text}
              setTodos={setTodos}
              todos={todos}
              todo={todo}
      />
    }
    return result;
  })
  return (
    <div className="todo-container">
      <ul className="todo-list">
    {elements}
    </ul>
  </div>
  );
}

export default Navbar;
